function MeshInfo()
{
	this.name = "";
	this.mtl = "";
	this.vertices  = [];
	this.indices     = [];
	this.finaluv     = []; //uv indices remapped
	this.uv = []; //original uv as-is
}
function parseSingleObject(words, currLine, vstart, uvStart )
{
	var meshinfo = new MeshInfo();
	var tempuvValIndices = [];
	var origVCount = 0;
	var origUVCount = 0;
	var max = 1;
	
	//max = 10; //for church, sqplane
	//max = 60; //for mask, russian church
	
	if(typeof meshinfo == 'undefined' || meshinfo == null)
	{
		alert("ran out of memory creating mesh");
		return meshinfo;
	}
       
	for (var i = currLine;i < words.length;i ++) 
	{  
		if (words[i+0] == "v") 
		{
			meshinfo.vertices.push(parseFloat(words[i+1])/max);
			meshinfo.vertices.push(parseFloat(words[i+2])/max);
			meshinfo.vertices.push(parseFloat(words[i+3])/max);
		} 	
		else if (words[i+0] == "o") 
		{
			//alert(words[i+1]);
			if(meshinfo.name == "")
				meshinfo.name = words[i+1];
			else break; //Only 1 object at a time
		}
		else if (words[i+0] == "usemtl") 
		{
			//alert(words[i+1]);
			meshinfo.mtl = words[i+1];
		}		
		else if (words[i+0] == "f")
		{ 
				if(words[i+1].split("/") == words[i+1]) alert("face error in " + meshinfo.name + "," + words[i+1]);		
				if(words[i+2].split("/") == words[i+2]) alert("face error in " + meshinfo.name);
				if(words[i+3].split("/") == words[i+3]) alert("face error in " + meshinfo.name);						
			if(words[i+1].split("/") != words[i+1])
			{
				meshinfo.indices.push(parseInt(words[i+1].split("/")[0])-1-vstart);
				meshinfo.indices.push(parseInt(words[i+2].split("/")[0])-1-vstart);
				meshinfo.indices.push(parseInt(words[i+3].split("/")[0])-1-vstart);
				
				//Will fix locations last
				tempuvValIndices.push(parseInt(words[i+1].split("/")[1])-1-uvStart);
				tempuvValIndices.push(parseInt(words[i+2].split("/")[1])-1-uvStart);
				tempuvValIndices.push(parseInt(words[i+3].split("/")[1])-1-uvStart);
			}
			else if(words[i+1].split("//") != words[i+1])//only v//vn is present (no vt)	
			{
				alert("no vt present");
			}
			else //only v is present (no vt/vn)	- useful for developing just shapes first
			{
				meshinfo.indices.push(parseInt(words[i+1])-1-vstart);
				meshinfo.indices.push(parseInt(words[i+2])-1-vstart);				  
				meshinfo.indices.push(parseInt(words[i+3])-1-vstart);
			}
		}
		else if (words[i+0] == "vt") 
		{
			var tempval = parseFloat(words[i+1]);
			meshinfo.uv.push(tempval);
			tempval = parseFloat(words[i+2]);
			meshinfo.uv.push(tempval);
		}      		
	}

	//retain orig counts for next run, as the array is going to get modified below
	origVCount = meshinfo.vertices.length/3;
	origUVCount = meshinfo.uv.length/2;
	
	//alert(tempuvValIndices);
	//alert(meshinfo.indices + ", " + vstart);
	if(1) // for debugging
	{
		//Now fix up the vertex <-> uv common index mess
		//Avoid sparseness for native porting
		meshinfo.finaluv = new Array(2*(meshinfo.vertices.length/3)); //u,v per vertex
		if(typeof meshinfo.finaluv == 'undefined' || meshinfo.finaluv == null)
		{
			alert("ran out of memory creating finaluv");
			return meshinfo;
		}		
		
		for(var tempindex = 0; tempindex < tempuvValIndices.length; tempindex ++)
		{
			//check if it is already filled
			if (typeof meshinfo.finaluv[meshinfo.indices[tempindex]*2] == 'undefined' 
					|| meshinfo.finaluv[meshinfo.indices[tempindex]*2] == null)
			{				
				meshinfo.finaluv[meshinfo.indices[tempindex]*2] = 
					meshinfo.uv[tempuvValIndices[tempindex]*2];
				meshinfo.finaluv[meshinfo.indices[tempindex]*2 + 1] = 
					meshinfo.uv[tempuvValIndices[tempindex]*2 + 1];			
			}
			else if(
				(meshinfo.finaluv[meshinfo.indices[tempindex]*2] != meshinfo.uv[tempuvValIndices[tempindex]*2])//find new place
				||
				(meshinfo.finaluv[meshinfo.indices[tempindex]*2 + 1] != meshinfo.uv[tempuvValIndices[tempindex]*2 + 1])
				)
			{
				//push to last
				meshinfo.finaluv.push(meshinfo.uv[tempuvValIndices[tempindex]*2]);
				meshinfo.finaluv.push(meshinfo.uv[tempuvValIndices[tempindex]*2 + 1]);
				//create new position for vertex also
				meshinfo.vertices.push(meshinfo.vertices[meshinfo.indices[tempindex]*3 + 0]);
				meshinfo.vertices.push(meshinfo.vertices[meshinfo.indices[tempindex]*3 + 1]);
				meshinfo.vertices.push(meshinfo.vertices[meshinfo.indices[tempindex]*3 + 2]);
				//update index finally
				meshinfo.indices[tempindex] = (meshinfo.finaluv.length/2) - 1;
			}
			else //if they are equal nothing to do
			{
				//alert("possible issue in uv - " + tempindex);
			}
		}
	}//if0

	return [meshinfo, i, origVCount, origUVCount];
}

	function parseOBJfile(objData)
	{
		var lastv = 0;
		var lastuv = 0;
		var lastline = 0;
		var sinfo;
		var fullsceneinfo = [];

	
	    var words = objData.split(" ");

		//Do it with a function
		for (var i = 0;i < words.length;i ++) 
		{  			
			if(words[i+0] == "o")
			{
				sinfo = parseSingleObject(words, i, lastv, lastuv);
				lastv += sinfo[2];
				lastuv += sinfo[3];
				lastline = sinfo[1];
				
				//alert(sinfo[0].name);
				//alert(fullsceneinfo.length + "," + sinfo[2] + "," + sinfo[3]);
				//alert(sinfo[0].vertices);
				//alert(sinfo[0].indices);
				//alert(sinfo[0].finaluv);
				
				fullsceneinfo.push(sinfo[0]);
				i = lastline-1; //jump to the next object
			}			
		}
		//alert(fullsceneinfo.length);
		if(fullsceneinfo.length == 0)
			alert("WARNING: 'o' objects not found in input");
		return fullsceneinfo;
	}


